<style>
.btn {
  width: 70px;
  height: 30px;
  text-align: center;
  padding: 15px 35px;
  background-color: #00BEC8;
  display: block;
  text-decoration: none;
  color: black;
  border-radius: 10px;
}
</style>
<style>
.cp_iptext {
	position: relative;
	width: 80%;
	margin: 40px 3%;
}
.cp_iptext input[type=text] {
	font: 15px/24px Hiragino Maru Gothic ProN
	box-sizing: border-box;
	width: 100%;
	margin: 8px 0;
	padding: 0.3em;
	transition: 0.3s;
	border: 1px solid #1b2538;
	border-radius: 4px;
	outline: none;
}
.text input[type=text]:focus {
	border-color: #da3c41;
}
.text input[type=text] {
	padding-left: 40px;
}
.text i {
	position: absolute;
	top: 8px;
	left: 0;
	padding: 9px 8px;
	transition: 0.3s;
	color: #aaaaaa;
}
.text input[type=text]:focus + i {
	color: #da3c41;
}
</style>

}

}

}

    height:100px;

    color:#fff;
    text-align: center;
}
.container{
    display: flex;
}
section{
    margin-bottom:50px;
}
main{
    width:70%;

}

.sidebar{
    width:30%;

}

}

}
